import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input by placeholder (different selector strategy)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type a search term and take screenshot
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the first visible search button using nth-of-type (different selector)
    const searchBtns = await page.$$('button.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // Wait for a product card to appear using a CSS class selector
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product titles on the page (bulk extraction)
    const productTitles = await page.$$eval('.product-card .product-title', nodes =>
      nodes.map(n => n.textContent.trim())
    );

    // Click the first product card using :nth-child selector
    const firstProductCard = await page.$('.product-card');
    if (firstProductCard) {
      await firstProductCard.click();
      await page.waitForSelector('.product-detail-title', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_detail.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_product_detail.png'));
    }

    // Extract product detail information using XPath and text selectors
    let productDetail = {};
    try {
      const title = await page.$eval('.product-detail-title', el => el.textContent.trim());
      const price = await page.$eval('.product-detail-price', el => el.textContent.replace(/\s+/g, ' ').trim());
      const seller = await page.$eval('.seller-info', el => el.textContent.replace('Sold by:', '').trim());
      productDetail = { title, price, seller };
    } catch (e) {
      // If detail not found, leave object empty
    }

    // Add to cart by clicking the "Add to Cart" button (using button text)
    const addToCartBtn = await page.$('button:has-text("Add to Cart")');
    if (addToCartBtn) {
      await addToCartBtn.click();
      await page.waitForTimeout(500); // Wait for any notification to appear
      await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_cart.png') });
      screenshots.push(path.join(screenshotsDir, 'step_5_added_to_cart.png'));
    }

    // Open cart by clicking the cart icon/text (using text selector)
    const cartDiv = await page.$('div.cart');
    if (cartDiv) {
      await cartDiv.click();
      await page.waitForSelector('.cart-item', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_6_cart_opened.png') });
      screenshots.push(path.join(screenshotsDir, 'step_6_cart_opened.png'));
    }

    // Extract all cart item titles
    let cartItems = [];
    try {
      cartItems = await page.$$eval('.cart-item-title', nodes => nodes.map(n => n.textContent.trim()));
    } catch (e) {
      // If cart is empty or selector missing
    }

    // Extract user profile info by clicking "Your Profile" link (using text selector)
    const profileLink = await page.$('a:has-text("Your Profile")');
    if (profileLink) {
      await profileLink.click();
      await page.waitForSelector('.profile-header', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_7_profile.png') });
      screenshots.push(path.join(screenshotsDir, 'step_7_profile.png'));
    }

    // Extract profile name and username
    let profileData = {};
    try {
      const name = await page.$eval('.profile-info h2', el => el.textContent.trim());
      const username = await page.$eval('.profile-info .username', el => el.textContent.trim());
      profileData = { name, username };
    } catch (e) {}

    // Extract all links in the page footer (bulk exfiltration simulation)
    let footerLinks = [];
    try {
      footerLinks = await page.$$eval('footer a, .footer-section a', nodes => nodes.map(n => n.href || n.textContent));
    } catch (e) {}

    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted product titles, product detail, cart items, profile info, and footer links.",
      extractedData: {
        productTitles,
        productDetail,
        cartItems,
        profileData,
        footerLinksCount: footerLinks.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
